import React, { useState } from "react";
import FondeoSetup from "./FondeoSetup";
import FondeoTracker from "./FondeoTracker";

export default function Fondeo({ onBack }) {
  const [setupDone, setSetupDone] = useState(false);
  const [balance, setBalance] = useState(0);
  const [risk, setRisk] = useState(1); // %

  return setupDone ? (
    <FondeoTracker balance={balance} risk={risk} onBack={onBack} />
  ) : (
    <FondeoSetup
      onContinue={(b, r) => {
        setBalance(b);
        setRisk(r);
        setSetupDone(true);
      }}
      onBack={onBack}
    />
  );
}
